import React from 'react';
import { BrowserRouter as Router,Routes, Route, Link } from 'react-router-dom';
import UploadPage from './pages/UploadPage';
import ImagesPage from './pages/ImagesPage';
import ImagesAnnotationPage from './pages/ImagesAnnotationPage';
import Nopage from './pages/Nopage'; 
// import { useState } from 'react';


function App() {
  // const [data,setData] = useState({});
  return (
    <Router>
      <nav>
        <Link to ="/">Home</Link>
        <Link to ="/image/upload">Uploaded Images</Link>
        <Link to ="/image/view">Image Page</Link>
        <Link to ="/image/edit">Image Annotation Page</Link>

      </nav>
      <Routes>
        <Route path = "/" element = {<UploadPage/>}/>
        <Route path = "/image/upload" element = {<UploadPage/>}/>
        <Route path = "/image/view" element = {<ImagesPage/>}/>
        <Route path = "/image/edit" element = {<ImagesAnnotationPage/>}/>
        <Route path = "*" element = {<Nopage/>}/>
      </Routes>
      <div>
        <a href="https://www.copyright.gov/what-is-copyright/#:~:text=Copyright%20is%20a%20type%20of,a%20tangible%20form%20of%20expression.">Copywrites</a>
      </div>
    </Router>
  );
}

export default App;


